import React, { useState, useEffect } from 'react'
import { useHistory, useRouteMatch } from 'react-router-dom'

function EntetyTable(props) {
    let history = useHistory()
    let match = useRouteMatch();

    const { entity } = props
    // console.log(entity)
    // if (props.entitys.filter(element => element.name == entity).length == 0)
    //     return '';
    return (
        <tr>
            <td onClick={() => history.push(`${match.path}/add/${entity}`)} style={{ cursor: 'pointer' }}>{entity.name}</td>
            <td></td>
            <td>{entity.children.length}</td>
            <td style={{ textAlign: 'center' }}><svg onClick={() => props.removeEntity(props.entity._id)}
                xmlns="http://www.w3.org/2000/svg"
                width="14"
                height="18"
                viewBox="0 0 14 18"
            >
                <g transform="translate(-5 -3)">
                    <path
                        fill="#b4b4b4"
                        d="M6 19a2.006 2.006 0 002 2h8a2.006 2.006 0 002-2V7H6zM19 4h-3.5l-1-1h-5l-1 1H5v2h14z"
                        data-name="TracÃ© 417"
                    ></path>
                </g>
            </svg></td>
        </tr>
    )


}

export default EntetyTable
